INSERT INTO `system_templates` VALUES ('989bac83b8004120845fb3f8791936e4', 'd64d167032c84521ad21708cccc1f963', NULL, NULL, NULL, NULL, NULL, '<p><strong style=\"white-space: normal; background-color: rgb(255, 255, 255); line-height: 24px; color: rgb(255, 255, 255); font-family: Arial; font-size: 15px; padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; transition: all 0.2s linear 0s; background-color: rgb(0, 128, 0);\">模板名称：</span></strong><br style=\"color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 26px;\"/><span style=\"color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\"><strong>财税记账工商注册认证公司类<a href=\"http://www.dede58.com/\" target=\"_blank\" style=\"color: rgb(70, 81, 96); letter-spacing: 1px; text-decoration-line: none;\"><span style=\"text-decoration:underline;\">织梦模板</span></a>(带手机端)+PC+移动端+利于SEO优化</strong></span><br style=\"font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: Tahoma, 宋体, Geneva, sans-serif; line-height: 25.2px;\"/><strong style=\"white-space: normal; background-color: rgb(255, 255, 255); line-height: 24px; color: rgb(255, 255, 255); font-family: Arial; font-size: 15px; padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; transition: all 0.2s linear 0s; background-color: rgb(0, 128, 0);\">模板介绍：</span></strong><br style=\"color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 26px;\"/><span style=\"color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255); line-height: 26px;\">织梦最新内核开发的模板，该模板属于财税记账、工商注册类企业使用，</span><br style=\"font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: Tahoma, 宋体, Geneva, sans-serif; line-height: 25.2px;\"/><span style=\"color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255); line-height: 26px;\"><span style=\"color: rgb(255, 0, 0);\">自带最新的手机移动端，同一个后台，数据即时同步，简单适用！</span><br/>原创设计、手工书写DIV+CSS，<br/>完美兼容IE7+、Firefox、Chrome、360浏览器等；主流浏览器；<br/>页面简洁简单，容易管理，DEDE内核都可以使用；附带测试数据！</span><br style=\"color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 26px;\"/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 24px; transition: all 0.2s linear 0s; width: 708px;\"><span style=\"color: rgb(51, 51, 51); font-family: Arial; font-size: 15px;\"><span style=\"padding: 0px; margin: 0px; transition: all 0.2s linear 0s; color: rgb(255, 255, 255);\"><strong style=\"padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; transition: all 0.2s linear 0s; background-color: rgb(0, 128, 0);\">模板特点：</span></strong></span></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255); line-height: 26px;\">该模板多数为单页面，修改很多需要在代码文件上修改，图片很多也需要通过FTP工具修改，<br/>因为财税类的页面比较多，所以很多都是写在模板文件上的！</p><p><strong style=\"color: rgb(255, 255, 255); padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; transition: all 0.2s linear 0s; background-color: rgb(0, 128, 0);\">&nbsp;使用程序：</span></strong></p><p><span style=\"color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 15px;\">织梦DEDECMS版本都可以使用。</span><br/><strong style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 15px; padding: 0px; margin: 0px;\"><span style=\"padding: 0px; margin: 0px; transition: all 0.2s linear 0s; color: rgb(255, 255, 255);\"><span style=\"padding: 0px; margin: 0px; transition: all 0.2s linear 0s; background-color: rgb(0, 128, 0);\">&nbsp;</span></span><span style=\"padding: 0px; margin: 0px; transition: all 0.2s linear 0s; color: rgb(240, 255, 240);\"><span style=\"padding: 0px; margin: 0px; transition: all 0.2s linear 0s; background-color: rgb(0, 128, 0);\">模板页面：</span></span></strong><br/><span style=\"color:#465160;font-family:Microsoft YaHei, Tahoma, Helvetica, Arial, sans-serif;color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif;\">index.htm 首页模板</span><br/><span style=\"color:#465160;font-family:Microsoft YaHei, Tahoma, Helvetica, Arial, sans-serif;color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif;\">head.htm</span><br/><span style=\"color:#465160;font-family:Microsoft YaHei, Tahoma, Helvetica, Arial, sans-serif;color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif;\">footer.htm&nbsp;</span><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif;\">article_article.htm 文章内容</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px;\"><span style=\"color:#465160;font-family:Microsoft YaHei, Tahoma, Helvetica, Arial, sans-serif;color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif;\">这里不一一列出！</span><br/><span style=\"color: rgb(255, 255, 255); font-family: &quot;Microsoft Yahei&quot;, Tahoma, STHeiti; background-color: rgb(51, 153, 102);\">&nbsp;温馨提示：</span><br/><span style=\"color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 15px;\">按照正常的织梦安装步骤来安装还原就可以用了，从后台重新点击保存下系统基本参数。 系统&gt;系统基本参数&gt; 保存（确定）。</span><br/><span style=\"color: rgb(255, 255, 255); font-family: &quot;Microsoft Yahei&quot;, Tahoma, STHeiti; background-color: rgb(51, 153, 102);\">&nbsp;后期bug修正：</span><br/><span style=\"color:#000000;font-family:Arial\"><span style=\"font-size: 15px;\">暂无</span></span><br/><span style=\"color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 15px;\">PC截图：</span></p><p><img alt=\"\" src=\"/upload/20190820/1566271920231067165.jpg\" style=\"border: none; color: rgb(70, 81, 96); font-family: &quot;Microsoft YaHei&quot;, Tahoma, Helvetica, Arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"/></p><p><br/></p>');
