INSERT INTO `system_versionnotes` VALUES ('c508f9f8fb7a4a99ae09154156d07fb8', '4f451c4797c54536869f5cf748944f9e', NULL, NULL, NULL, NULL, NULL, 'Previous Releases 1.0.1', '* 免费完整开源：基于MIT协议，源代码完全开源；\r\n* 标签化建站：不需要专业的后台开发技能，只要使用系统提供的标签，就能轻松建设网站；\r\n* 模版开发方便：支持在线上传模版包开发方便快捷；\r\n* 每月更新：每月进行系统升级，分享更多好用的模版与插件；');
